import React from 'react';
import ReactDOM from 'react-dom';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import FilledInput from '@material-ui/core/FilledInput';
import FormControl from '@material-ui/core/FormControl';
import FormHelperText from '@material-ui/core/FormHelperText';
import Input from '@material-ui/core/Input';
import InputLabel from '@material-ui/core/InputLabel';
import OutlinedInput from '@material-ui/core/OutlinedInput';
import TextField from '@material-ui/core/TextField';
import InputAdornment from '@material-ui/core/InputAdornment';

const styles = theme => ({
  container: {
    display: 'flex',
    flexWrap: 'wrap',
  },
  formControl: {
    margin: theme.spacing.unit,
  },
});

class ComposedTextField extends React.Component {


  render() {
    const { classes, handleEditChange } = this.props;

    return (
      <div className={styles.formControl}>

        <FormControl className={classes.formControl}>
          <InputLabel htmlFor="component-simple">Name1</InputLabel>
          <Input id="component-simple" value={this.state.name} onChange={handleEditChange()} />
        </FormControl>
        <FormControl className={classes.formControl} aria-describedby="component-helper-text">
          <InputLabel htmlFor="component-helper">Name</InputLabel>
          <Input id="component-helper" value={this.state.name} onChange={this.handleChange} />
          <FormHelperText id="component-helper-text">Some important helper text</FormHelperText>
        </FormControl>
        <FormControl className={classes.formControl} error aria-describedby="component-error-text">
          <InputLabel htmlFor="component-error">Name</InputLabel>
          <Input id="component-error" value={this.state.name} onChange={this.handleChange} />
          <FormHelperText id="component-error-text">Error</FormHelperText>
        </FormControl>
        <FormControl className={classes.formControl} variant="outlined">
          <InputLabel
            ref={ref => {
              this.labelRef = ReactDOM.findDOMNode(ref);
            }}
            htmlFor="component-outlined"
          >
            Name
          </InputLabel>
          <OutlinedInput
            id="component-outlined"
            value={this.state.name}
            onChange={this.handleChange}
            labelWidth={this.labelRef ? this.labelRef.offsetWidth : 0}
          />
        </FormControl>
        <FormControl className={classes.formControl} variant="filled">
          <InputLabel htmlFor="component-filled">Name</InputLabel>
          <FilledInput id="component-filled" value={this.state.name} onChange={this.handleChange} />
        </FormControl>

             <TextField

        id="outlined-number"
        label="Km"
        InputProps={{
          startAdornment: <InputAdornment position="start"></InputAdornment>,
        }}
        type="number"
        InputLabelProps={{
          shrink: true,
        }}
        margin="normal"



            />


      </div>

    );
  }
}

ComposedTextField.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(ComposedTextField);
